package ccc.interaction.internalFeatures;

import java.awt.Image;
import java.util.Calendar;

import javax.swing.ImageIcon;

import ccc.interaction.global.addons.MoonPhase;
import ccc.interaction.internalFeatures.alarmClockBeep.beeper;
import ccc.mainComponent.UI.mainRunnerCore;
import ccc.mainComponent.experimental.DEBUG;

public class moonPhaseUpdater {

	
	public static boolean clearNight = false;
	public static String moonCPic = "";
	public static String moonPhases = "";
	public static String moonDate = "";
	
	public static String m1 = "";
	public static String m2 = "";
	public static String m3 = "";
	public static String m4 = "";
	public static String m5 = "";
	public static String m6 = "";
	public static String m7 = "";
	public static String m8 = "";
	private static ImageIcon moonIcon;
	private static String m2A = "";
	private static String m3A = "";
	private static String m6A = "";
	private static String m7A = "";
	private static String conImage;

	public static void setMoonPhase() {
		 MoonPhase mp = new MoonPhase(Calendar.getInstance());
		 double mphase = mp.getPhase();
		 moonDate = mp.getMoonAgeAsDays();
		 if(mphase > 0) {
			 moonPhases = "New Moon";
			 submitImage(m1);
		 } if(mphase > 16.67) {
			 moonPhases = "Wanning Gibbous";
			 submitImage(m2);
		 } if(mphase > 33.34) {
			 moonPhases = "Wanning Gibbous";
			 submitImage(m2A);
		 } if(mphase > 50) {
			 moonPhases = "First Quarter";
			 submitImage(m3);
		 } if(mphase > 66.68) {
			 moonPhases = "Waxing Crescent";
			 submitImage(m3A);
		 } if(mphase > 83.35) {
			 moonPhases = "Waxing Crescent";
			 submitImage(m4);
		 } if(mphase > 95) {
			 moonPhases = "FullMoon";
			 submitImage(m5);
		 } if(mphase > -95 && mphase <0) {
			 moonPhases = "FullMoon";
			 submitImage(m5);
		 } if(mphase >-83.33 && mphase <0) {
				 moonPhases = "Wanning Gibbous";
			 submitImage(m6);
		 } if(mphase >- 66.66 && mphase <0) {
			 moonPhases = "Last Quarter";
			 submitImage(m7);
		 } if(mphase > -50 && mphase <0) {
			 moonPhases = "Waning Cresent";
			 submitImage(m7A);
		 } if(mphase > -33.33 && mphase <0) {
			 moonPhases = "Waning Cresent";
			 submitImage(m8);
		 } if(mphase > -16.67 && mphase <0) {
			 moonPhases = "New Moon";
			 submitImage(m1);
		 }
		 mainRunnerCore.moonPhaseLBL.setText("Moon Phase : " + moonPhases + "(" + (int) mphase + "%)");
	}

	private static void submitImage(String m) {
		conImage = m;
		
	}
	public static void confirmImage(int data) {
		if(data == 1) {
			moonCPic = conImage;
			Image image = Base64EncoderStatic.DecryptPicture(conImage);
			image = image.getScaledInstance(mainRunnerCore.moonPhase.getWidth()/2, mainRunnerCore.moonPhase.getHeight()/2, Image.SCALE_SMOOTH);
			moonIcon  = new ImageIcon(image);
			mainRunnerCore.moonPhase.setIcon(moonIcon);
		}else if(data == 2) {
			moonCPic = conImage;
			Image image = Base64EncoderStatic.DecryptPicture(conImage);
			image = image.getScaledInstance(mainRunnerCore.moonPhase.getWidth()/3, mainRunnerCore.moonPhase.getHeight()/3, Image.SCALE_SMOOTH);
			moonIcon  = new ImageIcon(image);
			mainRunnerCore.moonPhase.setIcon(moonIcon);
		}
	}
	public static void resetImage() {
		mainRunnerCore.moonPhase.setIcon(null);
	}
	
	public static void setPhaseDRemaining() {
		//DEBUG.print("Setting Moon Phase Remaining Day.");
		String[] seperator = moonDate.split(", ");
		String[] dayPointer = seperator[0].split(" ");
		String day = dayPointer[0];
		String[] hourPointer = seperator[1].split(" ");
		String hour = hourPointer[0];
		String[] minPointer = seperator[2].split(" ");
		String min = minPointer[0];
		
		int subDay = 0;
		if(Integer.valueOf(day) < 15) {
			subDay = 15-Integer.valueOf(day);
		}else {
			subDay = 15+Integer.valueOf(day);
		}
		
		String dayString = "day";
		
		if(Integer.valueOf(day) > 1) {
			dayString = "days";
		}else {
			dayString = "day";
		}
		
		String hourString = "hour";
		if(Integer.valueOf(hour) > 1) {
			hourString = "hours";
		}else {
			hourString = "hour";
		}
		
		
		String format = "Until next full moon : " + subDay + " " + dayString + ", " + hour + " " +hourString;
		mainRunnerCore.moonPhaseUntil.setText(format);
	}
}
